import React from 'react';
import SVGIcon from "../../components/svgs/SVGIcons";
import randomColor from "randomcolor";
import { render } from "react-dom";

import {ReactComponent  as Logo} from '../../resources/images/jplogo.svg';

import "./header.scss";

const styles = {
    display: "flex",
    flexWrap: "wrap",
    alignItems: "center",
    fontFamily: "sans-serif",
    justifyContent: "space-between"
  };

const menu_bar = () => {
    return (
        <nav>
            <div style={styles}>
    <SVGIcon name="wifi" width={100} fill={randomColor()} />
    <SVGIcon name="trash" width={100} fill={randomColor()} />
    <SVGIcon name="phone" width={100} fill={randomColor()} />
    <SVGIcon name="message" width={100} fill={randomColor()} />
    <SVGIcon name="envelope" width={100} fill={randomColor()} />
    <SVGIcon name="logo" width={100} fill={randomColor()} />

  </div>
        </nav>
    );
};

export default menu_bar;
